class PowerUp{constructor(a,b,c,d,e,f,g){this.img=a,this.x=b,this.y=c,this.speed=d,this.originalSpeed=d,this.powerUpWidth=e,this.powerUpHeight=f,this.type=g,this.characterWidth=e,this.characterHeight=f,this.visible=!0,this.picked=!1}display(){this.visible&&image(this.img,this.x,this.y,this.powerUpWidth,this.powerUpHeight)}move(){this.x-=this.speed}stop(){this.speed=0}restart(){this.speed=this.originalSpeed,this.move()}getPicked(){powerUpTheme.play(),this.picked=!0,this.visible=!1}}